export default defineComponent({
  name: 'Home',
  components: {
    Pagination,
    ProductList,
  },
  setup () {
    const store = useStore();
    const route = useRoute();
    const page = computed(() => parseInt(route.query.page as string, 10) || 1);
    const offset = computed(() => (page.value - 1) * 6);
    const { locale } = useI18n();


    watch(
      () => [page, locale],
      async () => {        
        const {
          data: response,
          getData
        } = useAxios(
          'getActivities',
          {
            offset: offset.value,
            limit: 6,
            venue_in: '164'
          },
        );
        await nextTick()
        await getData();

        store.dispatch(
        ROOT_STORE.ACTIONS.ITEM_LISTS,
        response.value.data.map((item: ItemData) => {
          const {
            uuid,
            cover_image_url,
            title,
            description,
            retail_price,
            original_retail_price,
            discount,
          } = item;

          return {
            uuid,
            cover_image_url,
            title,
            description,
            retail_price,
            original_retail_price,
            discount,
          }
        })
      );
      store.dispatch(ROOT_STORE.ACTIONS.ITEM_COUNT, response.value.meta.count ?? 0)
      },
      {
        immediate: true,
        deep: true,
      }
    )

    return {
      page,
      offset,
    }
  }
});

