import { reactive, toRefs } from "vue";
import api from '@/services';
import { ActivitiesResponse, AllFilterParams, ApiErrorTypes, FilterQueryParams, UseAxiosTypes } from "@/types";


export function useAxios(fn: string, params: FilterQueryParams | AllFilterParams): UseAxiosTypes {
  const state = reactive({
    data: {} as ActivitiesResponse,
    loading: false as boolean,
    error: {} as ApiErrorTypes,
  });

  const getData = async () => {
    state.loading = true;
    state.error = {} as ApiErrorTypes;
    state.data = {} as ActivitiesResponse;
    try {
      const response = await api[fn](params)
      state.data = response.data;

    } catch (err) {
      state.error = err;
    }
    state.loading = false;
  };

  return {
    ...toRefs(state),
    getData
  };
}

import { watch, Ref, computed, reactive, toRefs } from "vue";

export type PaginationControl = () => void;


export interface PaginationResult {
  pageSize: Ref<number>;
  total: Ref<number>;
  currentPage: Ref<number>;
  offset: Ref<number>;
  lastPage: Readonly<Ref<number>>;
  visiblePages: Readonly<Ref<(string | number | null)[]>>
  next: PaginationControl;
  prev: PaginationControl;
  first: PaginationControl;
  last: PaginationControl;
  goTo: (page:number) => void;
}

export interface PaginationOptions {
  pageSize: number;
  total: Ref<number>;
  currentPage: number;
  offset: number;
}

export function usePagination(options: PaginationOptions): PaginationResult {

  const state = reactive({
    currentPage: options.currentPage,
    pageSize: options.pageSize,
    total: options.total,
    offset: options.offset,
  })

  watch(
    () => state.currentPage,
    (newVal) => {
      if (newVal < 1) {
        state.currentPage = 1;
      }
    },
    {
      immediate: true,
    }
  )

  const lastPage = computed(() => Math.ceil(state.total / state.pageSize));

  const goTo = (page:number) => {
    state.currentPage = page
  };
  const prev = () => (goTo(state.currentPage - 1));
  const next = () => (goTo(state.currentPage + 1));
  const first = () => (goTo(1));
  const last = () => (goTo(lastPage.value));

  const visiblePages = computed(() => {
    const firstPage = state.currentPage > 3 ? 1 : null;
    const prevPage = state.currentPage >= 2 ? state.currentPage - 1 : null;
    const nextPage = state.currentPage >= lastPage.value ? null : state.currentPage + 1;
    const finalPage = nextPage && nextPage < lastPage.value ? lastPage.value : null;

    return [
      firstPage,
      firstPage ? '...' : null,
      prevPage,
      state.currentPage,
      nextPage,
      finalPage ? '...' : null,
      finalPage
    ].filter(Boolean);
  });

  watch(
    () => state,
    (newVal) => {
      if (newVal.currentPage > lastPage.value) {
        newVal.currentPage = lastPage.value;
      }
    },
    {
      deep: true,
    }
  )
  watch(
    () => state.currentPage,
    (newVal) => {
      state.offset = (newVal - 1) * state.pageSize;
    },
    {
      deep: true,
      immediate: true,
    }
  )

  return {
    ...toRefs(state),
    visiblePages,
    lastPage,
    next,
    prev,
    first,
    last,
    goTo,
  };
}

import { defineComponent, computed } from 'vue'
import { useStore } from 'vuex';
import { useI18n } from 'vue-i18n';
import IconWishlist from '@/components/icons/IconWishlist.vue';

import { BAG_STORE, WISHLIST_STORE } from "@/store/constants";
import { BagStateTypes, ItemData, WishlistStateTypes } from "@/store/interfaces";

export default defineComponent({
  components: {
    IconWishlist,
  },
  setup() {
    const store = useStore();
    const { t } = useI18n();
     const handleAddBagItem = (item: ItemData) => {
      store.dispatch(BAG_STORE.ACTIONS.ADD_BAG_ITEM, item)
    }

    const items = computed(() => store.state.itemLists as ItemData[]);

    const bagItems = computed(
      () =>
        ((store.state.bagModule as unknown) as BagStateTypes).bagItems
    );
    const wishlistItems = computed(
      () =>
        ((store.state.wishlistModule as unknown) as WishlistStateTypes).wishlistItems
    );
    const isInBag = (uuid: string) => bagItems.value.some(item => item.uuid === uuid);
    const isInWishlist = (uuid: string) => wishlistItems.value.some(item => item.uuid === uuid);
    const handleClickStar = (item: ItemData) => {
      if(isInWishlist(item.uuid)) {
        store.dispatch(WISHLIST_STORE.ACTIONS.REMOVE_WISHLIST_ITEM, item)
      } else {
        store.dispatch(WISHLIST_STORE.ACTIONS.ADD_WISHLIST_ITEM, item)
      }
    }
    return {
      items,
      handleAddBagItem,
      handleClickStar,
      isInBag,
      isInWishlist,
      t,
    }
  },
})

